import React, {Component} from 'react';
import NavBar from './components/NavBar';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

class App extends Component{


    render(){
        return(

            <div>
                <BrowserRouter>
                <NavBar/>
                    <Switch>
                        <Route path="/">
                            Hey
                        </Route>
                        <Route path="/experience">
                            Experience
                        </Route>
                    </Switch>
                </BrowserRouter>
            </div>
        )
    }
}


export default App
